  true,\n\t\"url\": null,\n\t\"notes\": \"The Public School Principals' Perceptions
  of Their School Facilities, Fall 2005 (FRSS 88), is a study that is part of the
  Fast Response Survey System (FRSS) program; program data is available since 1998-99
  at <http://nces.ed.gov/surveys/frss/downloads.asp>. FRSS 88 (http://nces.ed.gov/surveys/frss/)
  is a cross-sectional survey that collects and report data on principals' perceptions
  of their school facilities at the elementary and secondary levels. Principals in
  sampled schools received questionnaires regarding the condition of their school
  facilities. Respondents had the option of completing paper or web-based questionnaires.
  The studyufffds response weighted rate was 91 percent. Key statistics produced from
  FRSS 88 will provide current information about principalsufffd satisfaction with
  various environmental factors in their schools and the extent to which they perceive
  those factors as interfering with the ability of the school to deliver instruction.\",\n\t\"license_title\":
